  // 每个地址已众筹的额度\\r\\n    mapping(address => uint256) public joined;\\r\\n\\r\\n    // 上传报表格式参数\\r\\n    struct ReportInfo {\\r\\n        address token;\\r\\n        uint256 amount;\\r\\n    }\\r\\n\\r\\n    // 分期释放信息结构\\r\\n    struct TokenVestingInfo {\\r\\n        address tokenVesting;\\r\\n        uint256 tokenAmount;\\r\\n    }\\r\\n\\r\\n    // 通过受益人Token查分期释放信息\\r\\n    mapping(address => TokenVestingInfo) public TokenVestingInfoByBeneficiaryToken;\\r\\n\\r\\n    constructor(IERC20 token, address tokenWallet) Ownable() public {\\r\\n        require(address(token) != address(0), \\"CrowdsaleForAngel: token is the zero address\\");\\r\\n        require(tokenWallet != address(0), \\"CrowdsaleForAngel: token wallet is the zero address\\");\\r\\n        \\r\\n        _token = token;\\r\\n        _tokenWallet = tokenWallet;\\r\\n    }\\r\\n\\r\\n    // 上传报表数据\\r\\n    function updateList(ReportInfo[] memory list) public onlyOwner {\\r\\n        require(list.length > 0, \\"CrowdsaleForAngel： list array is null\\");\\r\\n        for (uint i = 0; i < list.length; i++) {\\r\\n            ReportInfo memory reportInfo = list[i];\\r\\n            if (reportInfo.amount > 0) {\\r\\n                _deliverTokens(reportInfo.token, reportInfo.amount);\\r\\n            }\\r\\n        }\\r\\n    }\\r\\n\\r\\n    // 执行提交\\r\\n    function _deliverTokens(address beneficiary, uint256 amount) internal {\\r\\n        uint256 tokenAmount = amount * (10**uint256(18));\\r\\n        // 记录参与人代币数量\\r\\n        joined[beneficiary] = joined[beneficiary].add(tokenAmount);\\r\\n\\r\\n        TokenVestingInfo storage info = TokenVestingInfoByBeneficiaryToken[beneficiary];\\r\\n        require(info.tokenVesting == address(0), \'CrowdsaleForAngel::deploy: The address has participated in crowdfunding\');\\r\\n\\r\\n        info.tokenVesting = address(new TokenVestingAngel(\\r\\n            beneficiary, // 受益人地址\\r\\n            block.timestamp // 当前众筹时间\\r\\n        ));\\r\\n        info.tokenAmount = tokenAmount;\\r\\n        // 代币转入分期释放合约地址\\r\\n        _token.safeTransferFrom(_tokenWallet, info.tokenVesting, tokenAmount);\\r\\n    }\\r\\n}\\r\\n","sourcePath":"/home/blues/Workspaces/DaoswapDex/daoswapdex-heco-mainnet/core-crowdsale/contracts/Crowdsale/CrowdsaleForAngel.sol","ast":{"absolutePath":"/home/blues/Workspaces/DaoswapDex/daoswapdex-heco-mainnet/core-crowdsale/contracts/Crowdsale/CrowdsaleForAngel.sol","exportedSymbols":{"CrowdsaleForAngel":[1503]},"id":1504,"nodeType":"SourceUnit","nodes":[{"id":1305,"literals":["solidity","^","0.5",".0"],"nodeType":"PragmaDirective","src":"0:23:6"},{"id":1306,"literals":["experimental","ABIEncoderV2"],"nodeType":"PragmaDirective","src":"25:33:6"},{"absolutePath":"@openzeppelin/contracts/ownership/Ownable.sol","file":"@openzeppelin/contracts/ownership/Ownable.sol","id":1307,"nodeType":"ImportDirective","scope":1504,"sourceUnit":2122,"src":"62:55:6","symbolAliases":[],"unitAlias":""},{"absolutePath":"@openzeppelin/contracts/math/SafeMath.sol","file":"@openzeppelin/contracts/math/SafeMath.sol","id":1308,"nodeType":"ImportDirective","scope":1504,"sourceUnit":2004,"src":"119:51:6","symbolAliases":[],"unitAlias":""},{"absolutePath":"@openzeppelin/contracts/token/ERC20/IERC20.sol","file":"@openzeppelin/contracts/token/ERC20/IERC20.sol","id":1309,"nodeType":"ImportDirective","scope":1504,"sourceUnit":2191,"src":"172:56:6","symbolAliases":[],"unitAlias":""},{"absolutePath":"@openzeppelin/contracts/token/ERC20/SafeERC20.sol","file":"@openzeppelin/contracts/token/ERC20/SafeERC20.sol","id":1310,"nodeType":"ImportDirective","scope":1504,"sourceUnit":2411,"src":"230:59:6","symbolAliases":[],"unitAlias":""},{"absolutePath":"/home/blues/Workspaces/DaoswapDex/daoswapdex-heco-mainnet/core-crowdsale/contracts/Crowdsale/CrowdsaleByERC20/emission/TokenVestingAngel.sol","file":"./CrowdsaleByERC20/emission/TokenVestingAngel.sol","id":1311,"nodeType":"ImportDirective","scope":1504,"sourceUnit":724,"src":"291:59:6","symbolAliases":[],"u